class Queue:
 def __init__(self):
 self.stack1 = []
 self.stack2 = []

 def enqueue(self, item):
 self.stack1.append(item)

 def dequeue(self):
 if not self.is_empty():
 return self.pop()

 def is_empty(self):
 return len(self.stack1) == 0 and len(self.stack2) == 0

 def pop(self):
 while True:
 try:
 top1 = self.stack1[-1]
 top2 = self.stack2[0]
 self.stack2.pop(0)
 self.stack1.remove(top1)
 break
 except IndexError:
 pass
 else:
 self.enqueue(False) # add the False value to the second stack for future use
 ```
To push items onto this queue, call `enqueue`. To retrieve an item from the front of the queue (if it exists), call `dequeue`, which will remove the first element added to the queue. If the queue is empty, then `dequeue` will raise an error unless you explicitly add the `try-except` block. The class also has methods to check whether the queue is currently empty (`isEmpty`) or whether there are any elements left in both stacks (`getLength`).

