def common_elements(A, B):
 maxlen = len(A) if len(A) >= len(B) else len(B)
 for i in range(maxlen):
 if A[i] == B[i]:
 return True
 return False
```
This function takes two arrays as input, iterates over each element from both arrays simultaneously until either array runs out of elements. If the current element at that position matches, then it returns true indicating there are common elements. Otherwise, it continues checking next positions until reaching the end of one of the arrays or finding a match.
